content:
@tedcruz Are you daft? 
Russia’s only supply of cash is selling oil. The threat by Europe to shut down the pipe if Russia invades Ukraine is the only real leverage the West has. 
It would be insane and destructive to NATO to force our allies to shut down the pipe now.

